import React from 'react';

const SettingsForm = () => {
  // Your component code here
  return (
    <div>
      SettingsForm
      <div style={{ display: 'flex', justifyContent: 'space-around' }}>
        <div style={{ backgroundColor: 'pink', padding: '10px', margin: '10px', borderRadius: '5px' }}>Sticker 1</div>
        <div style={{ backgroundColor: 'lightblue', padding: '10px', margin: '10px', borderRadius: '5px' }}>Sticker 2</div>
        <div style={{ backgroundColor: 'lightgreen', padding: '10px', margin: '10px', borderRadius: '5px' }}>Sticker 3</div>
      </div>
    </div>
  );
};

export default SettingsForm;
